import React from 'react'
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import './SpotInfoCard.scss';

const SpotInfoCard = ({ lat, lng, name, country, month, probability, isFavouriteSpot, onToggleFavourites, id }) => {
  console.log(name, country, month, probability);
  return(
    <Card className="spot-info-card" variant="outlined">
      <CardContent>
        <p>{lat}</p>
        {/* <p>{lng}</p>
        <p>{name}</p>
        <p>{country}</p>
        <p>{month}</p> */}
        <p>{probability}</p>
      </CardContent>
      <CardActions>
        <Button
            className="bg-primary h-25 ml-5"
            type="submit"
            variant="contained"
            color="primary"
            onClick={() => onToggleFavourites(id)}
          >
            { isFavouriteSpot ? "Remove From Favourites" : "Add To Favourites" }
        </Button>
      </CardActions>
    </Card>
  )
}

export default SpotInfoCard;
